NavigatorML.fragment:
interface mixin NavigatorML {
  [SecureContext, SameObject] readonly attribute ML ml;
};

MLContextOptions.fragment:
dictionary MLContextOptions {
  MLDeviceType deviceType = "cpu";
  MLPowerPreference powerPreference = "default";
};

ML.fragment:
[SecureContext, Exposed=(Window, DedicatedWorker)]
interface ML {
  Promise<MLContext> createContext(optional MLContextOptions options = {});
  Promise<MLContext> createContext(GPUDevice gpuDevice);
};

MLComputeResult.fragment:
dictionary MLComputeResult {
  MLNamedArrayBufferViews inputs;
  MLNamedArrayBufferViews outputs;
};

MLContext.fragment:
[SecureContext, Exposed=(Window, DedicatedWorker)]
interface MLContext {
  Promise<MLComputeResult> compute(
      MLGraph graph, MLNamedArrayBufferViews inputs, MLNamedArrayBufferViews outputs);
};

MLOperandDescriptor.fragment:
dictionary MLOperandDescriptor {
  // The operand type.
  required MLOperandDataType dataType;

  // The dimensions field is empty for scalar operands,
  // and non-empty for tensor operands.
  sequence<unsigned long> dimensions = [];
};

MLOperand.fragment:
[SecureContext, Exposed=(Window, DedicatedWorker)]
interface MLOperand {
  MLOperandDataType dataType();
  sequence<unsigned long> shape();
};

MLGraphBuilder.fragment:
[SecureContext, Exposed=(Window, DedicatedWorker)]
interface MLGraphBuilder {
  // Construct the graph builder from the context.
  constructor(MLContext context);

  // Create an operand for a graph input.
  MLOperand input(DOMString name, MLOperandDescriptor descriptor);

  // Create an operand for a graph constant.
  MLOperand constant(MLOperandDescriptor descriptor, ArrayBufferView bufferView);

  // Create a single-value operand from the specified number of the specified type.
  MLOperand constant(double value, optional MLOperandDataType type = "float32");

  // Compile the graph up to the specified output operands asynchronously.
  Promise<MLGraph> build(MLNamedOperands outputs);
};

MLArgMinMaxOptions.fragment:
dictionary MLArgMinMaxOptions {
  sequence<unsigned long> axes;
  boolean keepDimensions = false;
  boolean selectLastIndex = false;
};

MLBatchNormalizationOptions.fragment:
dictionary MLBatchNormalizationOptions {
  MLOperand scale;
  MLOperand bias;
  unsigned long axis = 1;
  float epsilon = 1e-5;
  MLActivation activation;
};

MLClampOptions.fragment:
dictionary MLClampOptions {
  float minValue;
